import { useEffect, useState } from "react"
import allVideos from "./exampleresponse.json"
import ReactPlayer from 'react-player'
import { useRef } from 'react';

const VideoCard = () => {
    const [allMyVideos, setAllMyVideos] = useState([])
    useEffect(() => {
        setAllMyVideos(allVideos)
        console.log(allMyVideos)
    }, [])
    const playerRef = useRef(null);
    return (
        allMyVideos.map(video => (
            <div key={video.key} className="card">
                <h4>{video.title}</h4>
                <div className="video-holder">
                    <ReactPlayer width={480} height={272} ref={playerRef} url={video.url} controls={true} fluid={false} />
                </div>
                <div className="text-holder">
                    <div className="rate">
                        <img className="image-heart" src="https://www.svgrepo.com/show/439915/heart-fill.svg"></img>
                        <span>{video.rating}</span>
                    </div>
                    <button className="up">
                        <img className="tumb-up" src="tumb-up">
                        </img>{video.rating}</button>
                    <button className="down">Rate Down</button>
                </div>
            </div >
        ))
    )
}

export default VideoCard
